import Head from 'next/head';
import Navbar from './Navbar';

const Layout = (props) => (
  <div>
    <Head>
      <title>BitzPrice</title>
      <link
        href='https://stackpath.bootstrapcdn.com/bootswatch/4.4.1/lux/bootstrap.min.css'
        rel='stylesheet'
        integrity='sha384-oOs/gFavzADqv3i5nCM+9CzXe3e5vXLXZ5LZ7PplpsWpTCufB7kqkTlC9FtZ5nJo'
        crossOrigin='anonymous'
      ></link>
    </Head>
    <Navbar />
    <div className='container'>{props.children}</div>
    <footer class='bd-footer p-3 p-md-5 mt-5 bg-light text-center text-sm-left'>
      <div className='container mt-4'>
        <span className='text-black-50'>
          Powered by{' '}
          <a href='https://www.coindesk.com/price/bitcoin'>CoinDesk</a>{' '}
        </span>
      </div>
    </footer>
  </div>
);

export default Layout;
